export default function Message() {
  const [message] = useState([
    {id:'001',title:'消息1',content:'11111'},
    {id:'002',title:'消息2',content:'11111'},
    {id:'001',title:'消息1',content:'11111'},
    {id:'001',title:'消息1',content:'11111'},
  ])
  return (
    <div>
      <ul>
        <li>
          <a href="/message1">message001</a>&nbsp;&nbsp;
        </li>
      </ul>
    </div>
  )
}
